    }else{
        str="bg-noob w-screen h-screen bg-cover"
    }
    return (
        <html className={str}>
        <Navbar/>
        <h1 className="text-center text-emerald-300 text-6xl font-suk">About me!</h1>
        <h2 className = "text-white px-5 font-bold font-par">My Experience :</h2>
        <p className = " font-par text-emerald-500">I am a self-taught Porgrammer</p>
        </html>
    );
}
